import './About.css';

function About() {
    return (
        <React.Fragment>
            <h1 className='center black bb bw1 br3 w-20 grow'>about</h1>

            <div className='black ba br3 w-50 center ma2 pa3'>
                <p>ToDoList app v1 was created</p>
                <p>GitHub: @seycileli</p>
                <p>September 19, 2020</p>
            </div>
        </React.Fragment>
    )
}

export default About
